class RocketParent extends React.Component {
	render() {
		const rockets = this.props.rockets;
		const rocketsArr = [];
		console.log(rockets);
		for (let keys in rockets){
			for (let [key, value] of Object.entries(rockets)) {
				rocketsArr.push(`${value.id}`);
			};
		};

		const array = Array(4).fill('TEST');
		console.log(array);

		return (
			<div>
				{array.map(array2 => (
					<p>{array2}</p>
				))}
			</div>
		);
	};
};

function Rocket() {

};

